import { pl } from "./languages/pl";
import { getString } from "./languages/string";

export const FiltersList = [
  { id: 0, name: pl.filters.nameaz, type: "name", inOrder: true },
  { id: 1, name: pl.filters.nameza, type: "name", inOrder: false },
  { id: 2, name: pl.filters.priceUp, type: "price", inOrder: true },
  { id: 3, name: pl.filters.priceDown, type: "price", inOrder: false },
];

export const CategoryFIlters = [
  {
    id: 0,
    name: getString("categories", "vegetables"),
    choosen: true,
    blocked: false,
  },
  { id: 1, name: pl.categories.fruits, choosen: true, blocked: true },
  { id: 2, name: pl.categories.spices, choosen: false, blocked: false },
  { id: 3, name: pl.categories.animals, choosen: false, blocked: false },
  { id: 4, name: pl.categories.dishes, choosen: true, blocked: false },
  { id: 5, name: pl.categories.polish, choosen: true, blocked: false },
  { id: 6, name: pl.categories.lactose, choosen: true, blocked: false },
  { id: 7, name: pl.categories.sugar, choosen: true, blocked: false },
  { id: 8, name: pl.categories.drink, choosen: true, blocked: false },
  { id: 9, name: pl.categories.herbs, choosen: true, blocked: false },
  { id: 10, name: pl.categories.exotic, choosen: true, blocked: false },
];
